import requests
from bs4 import BeautifulSoup


def news():
    # the target we want to open
    url = 'http://www.bellalombardia.regione.lombardia.it/lbltext/?tipoVista=02&tipoRicerca=01&categoria=A1&idBene=209&x=1036857.912&y=5737990.615&locale=it#'

    # open with GET method
    resp = requests.get(url)

    # http_respone 200 means OK status
    if resp.status_code == 200:
        print("Successfully opened the web page")
        print("The images are as follow :-\n")

        # we need a parser,Python built-in HTML parser is enough .
        soup = BeautifulSoup(resp.text, 'html.parser')
        div = soup.find('div', {"category": "A1"})
       #print(div)
        images = soup.findAll('img')
        for image in images:
           # print image source
            print(image['src'])

    else:
        print("Error")
